INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<p>Available on CD or digital download:</p><p><strong><a href="https://bit.ly/2776itunes">iTunes</a></strong></p><p><strong><a href="http://www.cdbaby.com/cd/2776">cdbaby</a></strong></p><p><strong><a href="http://bit.ly/2776amazon">Amazon</a></strong></p><p><strong><a href="http://bit.ly/2776google">Google Play</a></strong></p>', 'Buy It', 'full_html'),
(2, '<p>The year is 2776, and on the thousandth birthday of America, an evil Alien (<strong>Martha Plimpton</strong>) threatens to destroy the nation, unless the President (<strong>Will Forte</strong>) and his Secret Service agent (<strong>Aubrey Plaza</strong>) can convince her it&rsquo;s worth saving. Together with a cranky George Washington (<strong>Paul F. Tompkins</strong>) they travel through our nation&rsquo;s history&mdash;past AND future, taking on everything American &mdash; immigration, religion, the media, sports, politics, sex, droids, and rock n&rsquo; roll. Along the way they meet notable Americans, from God (<strong>Patton Oswalt</strong>) to the Common Cold (<strong>Aimee Mann</strong>). Can America be saved? Kind of. It&rsquo;s complicated.</p><p>2776 is an epic musical/comedy extravaganza featuring 28 tracks and over 80 comedians, musicians and actors to benefit OneKid OneWorld. 2776 will be released on July 4, 2014 and is available for preorder today. 2776 was created by The Levinson Brothers and Rob Kutner.&nbsp;</p><p>Follow us on Twitter at <a href="https://twitter.com/2776Updates">@2776Updates</a></p><p>Like us on Facebook at <a href="https://www.facebook.com/2776album">2776album</a></p><p><a href="http://www.funnyordie.com/slideshows/f3bd307bfa/2776-the-covers">Amazing cover art from all 28 tracks</a></p>', 'What is 2776?', 'full_html'),
(3, '<a class="twitter-timeline" href="https://twitter.com/2776Updates" data-widget-id="502562281964572672">Tweets by @2776Updates</a>\r\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?''http'':''https'';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+"://platform.twitter.com/widgets.js";fjs.parentNode.insertBefore(js,fjs);}}(document,"script","twitter-wjs");</script>\r\n', 'twitter feed', 'full_html'),
(4, '<p>(in order of appearance) Will Forte &bull; Aubrey Plaza &bull; Martha Plimpton &bull; Ashanti &bull; Baron Vaughn &bull; Andy Richter &bull; Alonzo Bodden &bull; Loaded Lux &bull; Paul Myers &bull; Patton Oswalt &bull; &quot;Steady Rollin&quot; Bob Margolin &bull; Aimee Mann &bull; The Sklar Brothers &bull; Al Jaffee &bull; Dick Gregory &bull; Dick Cavett &bull; Joe Franklin &bull; Margaret Cho &bull; Marc Yaffee &bull; Reggie Watts &bull; Right Said Fred &bull; Mayim Bialik &bull; Triumph the Insult Comic Dog&nbsp;&bull; The Rebirth Brass Band&nbsp;&bull; Maria Bamford&nbsp;&bull; Jonathan Katz&nbsp;&bull; Horatio Sanz&nbsp;&bull; Brian Stack&nbsp;&bull;&nbsp;Dave Hill &bull;&nbsp;Martha Plimpton&nbsp;&bull; Paul F. Tompkins &bull; Andrew W.K. &bull; Neko Case&nbsp;&bull;&nbsp;Kelly Hogan&nbsp;&bull; Colton Dunn<span style="line-height: 1.538em;">&nbsp;&bull;&nbsp;</span><span style="line-height: 1.538em;">Brandon Johnson</span><span style="line-height: 1.538em;">&nbsp;&bull;&nbsp;</span><span style="line-height: 1.538em;">Zach Sherwin</span><span style="line-height: 1.538em;">&nbsp;&bull;&nbsp;</span><span style="line-height: 1.538em;">Mike Mills</span><span style="line-height: 1.538em;">&nbsp;</span>&bull;&nbsp;<span style="line-height: 1.538em;">Basic Cable Band&nbsp;</span>&nbsp;&bull;&nbsp;<span style="line-height: 1.538em;">Nina Totenberg</span><span style="line-height: 1.538em;">&nbsp;&bull;&nbsp;</span><span style="line-height: 1.538em;">Dahlia Lithwick</span>&nbsp;&bull;&nbsp;<span style="line-height: 1.538em;">Bobcat Goldthwait</span>&nbsp;&bull;&nbsp;<span style="line-height: 1.538em;">Sally Timms</span>&nbsp;&bull;&nbsp;<span style="line-height: 1.538em;">Yo La Tengo&nbsp;</span><span style="line-height: 1.538em;">&bull;</span><span style="line-height: 1.538em;">&nbsp;Ira Glass</span><span style="line-height: 1.538em;">&nbsp;&bull;&nbsp;</span><span style="line-height: 1.538em;">Eugene Mirman</span>&nbsp;&bull;&nbsp;<span style="line-height: 1.538em;">Miguelito&nbsp;</span>&nbsp;&bull;&nbsp;<span style="line-height: 1.538em;">Ed Helms</span>&nbsp;&bull;<span style="line-height: 1.538em;">&nbsp;Apple Sisters &bull; Eric Johnson &bull; Mark McKinney &bull; Scott Thompson &bull; Bruce McCulloch &bull; Will Arnett &bull; Samantha Bee &bull; Cobie Smulders &bull; Alex Trebek &bull; Steven Page &bull; Craig Northey</span></p>', 'The Talent', 'full_html'),
(5, '<p>MUSIC VIDEOS</p><p><a href="https://www.youtube.com/watch?v=nZuvOzN1yOQ">These Aren&#39;t the Droids (Neko Case &amp; Kelly Hogan, featuring Ellie Kemper)</a></p><p><a href="https://www.youtube.com/watch?v=surS1xgLwzg">I&#39;m Cured (Aimee Mann)&nbsp;</a></p><p><a href="https://www.youtube.com/watch?v=k_y4lmJyGq4">Toymageddon (Yo La Tengo, Ira Glass, Eugene Mirman)</a></p><p>EXTRAS</p><p><a href="https://www.youtube.com/watch?v=uG8To6UZdUw">The Future of Dating (Aubrey Plaza and Will Forte)</a></p><p><a href="https://www.youtube.com/watch?v=vk2tfsaYIvo">Triumph the Insult Comic Dog meets the Rebirth Brass Band</a></p><p><a href="http://www.funnyordie.com/videos/26a040b89d/2776-the-album">Clucky McFeathersnest Explains 2776</a></p><p>ARTWORK</p><p><a href="http://www.funnyordie.com/slideshows/f3bd307bfa/2776-the-covers">2776: The Covers</a></p><p><a href="http://www.funnyordie.com/slideshows/048fd51fad/12-apocalyptic-days-of-christmas">12 Apocalyptic Days of Christmas</a></p><p><a href="http://www.funnyordie.com/lists/81d4e1fcd4/valentine-s-day-cards-from-political-figures-throughout-history">Valentine&#39;s Day from Historical Figures</a></p><p>&nbsp;</p>', 'Videos', 'full_html'),
(6, '<p>The creators and artists have agreed to donate all profits from the sale of 2776 to&nbsp;<a href="http://onekidoneworld.org"><b>OneKid OneWorld</b></a>.</p><a href="http://onekidoneworld.org"><b>OneKid OneWorld</b></a> provides a foundation for education in impoverished communities throughout Kenya and El Salvador by giving children from primary school up through secondary school the opportunity for a better and brighter future.', 'Charity', 'full_html'),
(7, '<p>&ldquo;<em><a href="http://pitchfork.com/artists/693-neko-case/">Neko Case</a>&nbsp;and <a href="http://pitchfork.com/artists/1962-kelly-hogan/">Kelly Hogan</a>&nbsp;recently shared <a href="http://pitchfork.com/news/55423-neko-case-and-kelly-hogan-imagine-a-sci-fi-future-invented-by-women-not-teen-boys-on-funny-song-these-arent-the-droids/">&quot;These Aren&#39;t the Droids&quot;</a>, a very funny song that critiques teen fanboy culture. That song now has a video, which is, unsurprisingly, also very funny.</em>&rdquo; &ndash; Pitchfork<br /><br /><strong><a href="http://localhost/2776/quotes" style="font-size: 13px;">See what other people have to say...</a></strong></p>', 'quotes', 'full_html');
