 WK song premiere, album profile</a></div><div>&nbsp;</div><div><strong><span style="font-size:18px;">New Yorker, June 17</span></strong><br /><a href="http://www.newyorker.com/online/blogs/culture/2014/06/a-musical-comedy-journey-through-america.html" style="font-size: 18px;" target="_blank">A Musical-Comedy Journey Through America</a></div><div>&nbsp;</div><div><strong><span style="font-size:18px;">ConsequenceOfSound, June 12</span></strong><br /><span style="font-size: 18px;"><a href="http://consequenceofsound.net/2014/06/listen-mayim-bialik-raps-on-journey-to-anywhen-featuring-reggie-watts/" style="font-size: 16px;" target="_blank">Listen: Mayim Bialik raps on &ldquo;Journey to Anywhen&rdquo; featuring Reggie Watts</a></span></div><div>&nbsp;</div><div><strong><span style="font-size:18px;">FashionTImes, June 18</span></strong><br /><span style="font-size: 16px;">The Big Bang Theory Star Mayim Bialik Raps for Charity</span></div><div>&nbsp;</div><div><a href="http://pitchfork.com/news/55423-neko-case-and-kelly-hogan-imagine-a-sci-fi-future-invented-by-women-not-teen-boys-on-funny-song-these-arent-the-droids/" target="_blank"><strong><span style="font-size:18px;">Pitchfork</span></strong></a></div><div>&nbsp;</div><div><strong style="font-size: 16px;"><span style="font-size:18px;">HitFix, June 2</span></strong><br /><a href="http://www.hitfix.com/comedy/10-fantastic-feminist-lyrics-from-neko-case-and-kelly-hogan-new-star-wars-song" style="font-size: 16px;" target="_blank">Droids lyrics gif breakdown</a></div><div>&nbsp;</div><div><strong><span style="font-size:18px;">AjournalOfAllThingsMusical, June 4</span></strong><br /><span style="font-size: 18px;"><a href="http://ajournalofmusicalthings.com/new-neko-song-perfect-star-wars-fans-sort-arent-droids-looking/" style="font-size: 16px;" target="_blank">New Neko Song Is Perfect for Star Wars Fans-Sort Of: &nbsp;&ldquo;These Aren&rsquo;t The Droids&rdquo; You Rre Looking For&rdquo;</a></span></div><div>&nbsp;</div><div><strong><span style="font-size:18px;">TheInterrobang, June 2</span></strong><br /><span style="font-size: 18px;"><a href="http://theinterrobang.com/comedy-and-music-mega-album-2776-will-benefit-education-in-kenya-and-el-salvador/" style="font-size: 16px;" target="_blank">Comedy and Music Mega-Album &lsquo;2776&rsquo; Will Benefit Education</a></span></div><div>&nbsp;</div><div><strong><span style="font-size:18px;">Laughspin.com</span></strong><br /><span style="font-size: 18px;"><a href="http://www.laughspin.com/2014/06/05/margaret-cho-patton-oswalt-paul-f-tompkins-and-many-more-join-for-musical-comedy-album-benefitting-onekid-oneworld-videos/" style="font-size: 16px;" target="_blank">News + Droids post</a></span></div><div>&nbsp;</div><div><a href="http://lamusicblog.com/2014/06/news/comic-benefit-album-2776-drops-on-july-4th/" target="_blank"><strong><span style="font-size:18px;">LAMusicBlog</span></strong></a></div>', '', 'full_html'),
('node', 'page', 0, 10, 10, 'und', 0, '<div><div><span style="font-size:18px;"><em>&ldquo;Neko Case and Kelly Hogan recently shared &quot;These Aren&#39;t the Droids&quot;, a very funny song that critiques teen fanboy culture. That song now has a video, which is, unsurprisingly, also very funny.&rdquo;</em> &ndash; <strong>Pitchfork</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;a terrific sendup of both fanboy culture and the prevalance of misogyny in society, with some poignant lessons about treating women thrown in&hellip;Now, Case and Hogan have ratcheted up the hilarity with a video for the song in which they dress up as Star Wars and Trek icons, with Hogan as Chewbacca and Case as a hybrid Leia/Spock&rdquo;</em> - <strong>SPIN</strong></span></div><div>&nbsp;</div><div><em><span style="font-size:18px;">&ldquo;Neko Case and Kelly Hogan have made a funny video to go along with their equally amusing song.&rdquo; &ndash; BaebleMusic</span></em></div><div><span style="font-size:18px;"><em>&ldquo;this song about a teenage boy imagined future/dystopia is gut-clutchingly hysterical.&rdquo;</em> &ndash;<strong> Nerdist</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;This little comic gem is a rebel song in the plainest sense&rdquo;</em> -<strong> Chartattack</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&quot;This may be the greatest video of all time.&quot;</em> &ndash; <strong>Telescopemedia</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Neko Case and Kelly Hogan take aim and fire at the fantasies of the future beloved of sci-fi and comic-book fanboys in their new video, &quot;These Aren&#39;t the Droids.&rdquo;&rdquo;</em> &ndash; <strong>The Straight</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;&ldquo;These Aren&rsquo;t The Droids&rdquo;, a hilarious song that pokes fun at teenage boys and the kinds of stuff they tend to obsess over. Now, the track&rsquo;s received the video treatment and it&rsquo;s just as chuckle-worthy as you&rsquo;d expect.&rdquo;</em> &ndash;<strong> ConsequenceOfSound</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;On &ldquo;These Aren&rsquo;t The Droids,&rdquo; a song from the comedy-and-music benefit compilation 2776, Neko Case and her longtime collaborator Kelly Hogan lamented the idea that dorked-out dudes are going to decide what the future is. And the brand-new video has fun with that idea&rdquo;</em> &ndash; <strong>Stereogum</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Last month, Neko Case and Kelly Hogan unveiled their comedic collaboration &quot;These Aren&#39;t the Droids.&quot; If any song has ever warranted a video, it&#39;s this one, so we&#39;re thankful that they delivered with a new clip.&rdquo;</em> &ndash; <strong>Exclaim!</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Everybody&#39;s buzzing about the new comedy album 2776, which is chock full of famous comedians and personalities, riffing about the future and science-fictional stuff. Almost everybody you love is on this album&rdquo;</em> &ndash; <strong>io9.com</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&quot;2776 sounds like They Might Be Giants crashed their car into Styx&#39;s garage studio. It&#39;s like Golden Throats for comedians.&quot; </em>&nbsp;- <strong>LA Weekly</strong></span></div><div>&nbsp;</div><div><em><span style="font-size:18px;">&ldquo;A throwback to a time where comedy albums were comprised of songs, skits and even lon</span></em><span style="font-size: 18px;"><em>ger audio sketches with a through line that create a sort of comedic audio play. And for a cause to boot!&rdquo; </em>&ndash; <strong>990WBOB</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;It&rsquo;s an amazing feat that Kutner and the Levinsons were able to assemble such a diverse and wide-ranging roster of talent (Dick Cavett and Margaret Cho on the same track, anyone?) The fact that so many people contributed to the album&rsquo;s production, to borrow a cliché, provides something for everyone&hellip; with so much talent and for such a good cause, 2776 is worth the price&rdquo;</em> - <strong>TheSpitTake</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;soon-to-be epic smash hit comedy album&rdquo;</em> &ndash;<strong> VideoContestNews</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;So much music! So much comedy! So much charity! So go get it!&rdquo;</em> &ndash;<strong> Wits Radio</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;The songs are fun, witty, and span a vast array of styles. From operetta to techno it&rsquo;s all here and our stars tackle the genre they&rsquo;ve been assigned with gusto.&rdquo;</em></span><span style="font-size: 18px; line-height: 20px;">&nbsp;&ndash;&nbsp;</span><span style="font-size:18px;"><strong>ComedyReviews</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Prove your love for America by buying the album&rdquo;</em> &ndash; <strong>SplitSider.com</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Sklar Brothers unleash the sports anthem of the year&rdquo;</em> &ndash; <strong>Guyism.com</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;packed with satirical takes on American culture&rdquo;</em> &ndash; <strong>AV Club</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;2776, The Comedy, Music, Historical Retrospective Extravaganza&rdquo;</em> &ndash; <strong>TheComedyBureau</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Anytime I can hear Mayim Bialik rap, I&#39;m having a pretty good day&hellip; Big Bang Theory and Blossom aficionados may be shocked to hear the actress spit rhymes on a song from 2776, a new celebrity-filled comedy album that benefits the charity OneKid OneWorld&rdquo;</em> &ndash; <strong>USA Today PopCandy</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;The most patriotic way to celebrate July 4th: laughing at ourselves. 2776&mdash;a part music, part comedy concept album&mdash;drops tomorrow, featuring a list of awesome people too long to list here poking fun at all things American.&rdquo;</em> &ndash; <strong>GQ.com</strong>, The Punch List</span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;Andrew WK contributes a track called &ldquo;Party On Your Grave&rdquo; that combines the epic power and guitar shredditude of a vintage Judas Priest track with lyrics about getting revenge on an enemy, Andrew WK-style: by partying as hard as possible.&rdquo;</em> &ndash; <strong>EW.com</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;2776, a time-traveling concept album about America, robots, aliens, philosophy, the future, and a bunch of other stuff, performed by an eclectic cast of 82 actors and musicians&mdash;including Patton Oswalt, Aubrey Plaza, Reggie Watts, Right Said Fred, Neko Case, Ed Helms, and NPR&rsquo;s Nina Totenberg. It&rsquo;s probably the only album coming out this year where you&rsquo;ll hear Triumph the Insult Comic Dog working with the Rebirth Brass Band, or k.d. lang collaborating with Alex Trebek.&rdquo;</em> &ndash; <strong>EW.com</strong></span></div><div>&nbsp;</div><div><span style="font-size:18px;"><em>&ldquo;&ldquo;Liner Notes,&rdquo; written by George Saunders, is a loonily satiric rumination on music, America, and creative collaboration that imagines, for example, Beyoncé singing about making love to Jay Z astride the atomic bomb.&rdquo;</em> &ndash; <strong>New Yorker</strong></span></div></div><p>&nbsp;</p>', '', 'full_html'),
('node', 'page', 0, 11, 11, 'und', 0, '<p>Testing this out.</p><p>&nbsp;</p><p>[[{"fid":"14","view_mode":"default","fields":{"format":"default"},"type":"media","attributes":{"class":"media-element file-default"}}]]<br /></source></source></p>', '', 'full_html'),
