('node', 'page', 0, 3, 3, 'und', 0, '<p style="text-align: center;"><span style="font-size:18px;">The year is 2776, and on the thousandth birthday of America, an evil Alien (Martha Plimpton) threatens to destroy the nation, unless the President (Will Forte) and his Secret Service agent (Aubrey Plaza) can convince her it&rsquo;s worth saving. Together with a cranky George Washington (Paul F. Tompkins), they travel through our nation&rsquo;s history&mdash;past AND future, taking on everything American &mdash; immigration, religion, the media, sports, politics, sex, droids, and rock n&rsquo; roll. Along the way they meet notable Americans, from God (Patton Oswalt) to the Common Cold (Aimee Mann). Can America be saved? Kind of. It&rsquo;s complicated. Created by The Levinson Brothers and Rob Kutner, 2776 is an epic musical/comedy extravaganza featuring 28 tracks and over 80 comedians, musicians and actors to benefit OneKid OneWorld. <strong><a href="http://www.cdbaby.com/cd/2776">Physical</a></strong>&nbsp;and <strong><a href="http://smarturl.it/2776">digital</a></strong> copies of the album are available now.</span></p>', '', 'full_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<div style="text-align: center;">&nbsp;</div><div style="text-align: center;"><span style="font-size:22px;"><strong>In Order Of Appearance</strong></span></div><div style="text-align: center;">&nbsp;</div><div><span style="font-size:18px;">Will Forte &bull; Aubrey Plaza &bull; Martha Plimpton &bull; Ashanti &bull; Baron Vaughn &bull; Andy Richter &bull; Alonzo Bodden &bull; Loaded Lux &bull; Paul Myers &bull; Patton Oswalt &bull; &quot;Steady Rollin&quot; Bob Margolin &bull; Aimee Mann &bull; The Sklar Brothers &bull; Al Jaffee &bull; Dick Gregory &bull; Dick Cavett &bull; Joe Franklin &bull; Margaret Cho &bull; Marc Yaffee &bull; Reggie Watts &bull; Right Said Fred &bull; Mayim Bialik &bull; Triumph the Insult Comic Dog &bull; The Rebirth Brass Band &bull; Maria Bamford &bull; Jonathan Katz &bull; Horatio Sanz &bull; Brian Stack &bull; Dave Hill &bull; Martha Plimpton &bull; Paul F. Tompkins &bull; Andrew W.K. &bull; Neko Case &bull; Kelly Hogan &bull; Colton Dunn &bull; Brandon Johnson &bull; Zach Sherwin &bull; Mike Mills &bull; Basic Cable Band &bull; Nina Totenberg &bull; Dahlia Lithwick &bull; Bobcat Goldthwait &bull; Sally Timms &bull; Yo La Tengo &bull; Ira Glass &bull; Eugene Mirman &bull; Miguelito &bull; Ed Helms &bull; Apple Sisters &bull; Eric Johnson &bull; Mark McKinney &bull; Scott Thompson &bull; Bruce McCulloch &bull; Will Arnett &bull; k.d. lang &bull; Samantha Bee &bull; Cobie Smulders &bull; Alex Trebek &bull; Steven Page &bull; Craig Northey</span></div>', '', 'full_html'),
('node', 'page', 0, 7, 7, 'und', 0, '<p style="text-align: center;"><!--MEDIA-WRAPPER-START-1--><img alt="" class="media-element file-default" data-file_info="%7B%22fid%22:%2217%22,%22view_mode%22:%22default%22,%22fields%22:%7B%22format%22:%22default%22,%22field_file_image_alt_text%5Bund%5D%5B0%5D%5Bvalue%5D%22:%22%22,%22field_file_image_title_text%5Bund%5D%5B0%5D%5Bvalue%5D%22:%22%22%7D,%22type%22:%22media%22%7D" src="http://localhost/2776/sites/default/files/itunes-promo.png" /></p><p style="text-align: center;"><strong style="font-size: 13px;"><span style="font-size:28px;">Available on CD or digital download:</span></strong></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><span style="font-size:18px;"><a href="https://bit.ly/2776itunes">iTunes</a></span></p><p style="text-align: center;"><span style="font-size:18px;"><a href="http://www.cdbaby.com/cd/2776">cdbaby </a></span></p><p style="text-align: center;"><span style="font-size:18px;"><a href="http://bit.ly/2776amazon">Amazon </a></span></p><p style="text-align: center;"><span style="font-size:18px;"><a href="http://bit.ly/2776google">Google Play</a></span></p>', '', 'full_html'),
('node', 'page', 0, 8, 8, 'und', 0, '<center><div>&nbsp;</div><div><div style="font-size: 13px; line-height: 20px;"><span style="font-size:18px;">The creators and artists have agreed to donate all profits from the sale of 2776 to&nbsp;<strong style="font-size: 20px;"><a href="http://onekidoneworld.org/" style="font-size: 20px;">OneKid OneWorld</a></strong>.</span></div><div style="font-size: 13px; line-height: 20px;">&nbsp;</div><div style="font-size: 13px; line-height: 20px;"><span style="font-size:18px;"><strong style="font-size: 20px;"><a href="http://onekidoneworld.org/" style="font-size: 20px;">OneKid OneWorld</a></strong>&nbsp;provides a foundation for education in impoverished communities throughout Kenya and El Salvador by giving children from primary school up through secondary school the opportunity for a better and brighter future.</span></div><div style="font-size: 13px; line-height: 20px;">&nbsp;</div></div><div>&nbsp;</div><div><!--MEDIA-WRAPPER-START-1--><img alt="" class="media-element file-default" data-file_info="%7B%22fid%22:%2215%22,%22view_mode%22:%22default%22,%22fields%22:%7B%22format%22:%22default%22,%22field_file_image_alt_text%5Bund%5D%5B0%5D%5Bvalue%5D%22:%22%22,%22field_file_image_title_text%5Bund%5D%5B0%5D%5Bvalue%5D%22:%22%22%7D,%22type%22:%22media%22%7D" src="http://localhost/2776/sites/default/files/STICKER_2776_two_and_a_half_inches.png" style="width: 300px; height: 300px;" /></div></center>', '', 'full_html'),
('node', 'page', 0, 9, 9, 'und', 0, '<p><strong><span style="font-size:18px;">UPROXX &ndash; Filmdrunk album post, August 13</span></strong><br /><a href="http://uproxx.com/filmdrunk/2014/08/2776-how-three-comedians-got-a-bunch-of-famous-people-to-make-a-comedy-album-in-their-garage/" style="font-size: 16px;" target="_blank">2776: How Three Comedians Got A Bunch Of Famous People To Make A Comedy Album in Their Garage</a></p><p><strong><span style="font-size:18px;"><a href="http://wrongbuttonblog.com/2776-comedy-album/" target="_blank">Wrong Button Blog post, August 13</a></span></strong></p><p><strong><span style="font-size:18px;">Zulkey album post, August 13</span></strong></p><p><strong><span style="font-size:18px;">The New York Times &lsquo;Notable releases&rsquo;, July 29</span></strong><br /><a href="http://zulkey.com/2014/08/2776-the-biggest-comedy-music-album-of-the-millenn.shtml#.U-0Clo1dVBM" style="font-size: 16px;" target="_blank">Punch Lines, Commentary and Rants:</a><br /><a href="http://zulkey.com/2014/08/2776-the-biggest-comedy-music-album-of-the-millenn.shtml#.U-0Clo1dVBM" style="font-size: 16px;" target="_blank">Patton Oswalt, Morgan Murphy and Others Have Comedy Specials</a></p><p><strong><span style="font-size:18px;"><a href="http://www.laughspin.com/2014/07/25/triumph-the-insult-comic-dog-will-insult-you-on-video-and-for-worthy-cause-contest/" target="_blank">Laughspin Triumph contest post, July 25</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="https://www.youtube.com/watch?v=UrrvFefWM3A" target="_blank">Entertainment Weekly Must-List (video feature), July 21</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://www.classicalite.com/articles/9800/20140715/according-to-comedy-album-2776-the-geeks-shall-inherit-the-earth.htm?exe=reporter" target="_blank">Classicalite album post, July 16</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://www.chicagotribune.com/entertainment/chi-neko-case-these-arent-the-droids-column.html" target="_blank">Chicago Tribune Droids video post , July 11</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://exclaim.ca/MusicVideo/ClickHear/neko_case_kelly_hogan-these_arent_droids_video" target="_blank">Exclaim! Droids video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://www.straight.com/blogra/684166/neko-case-and-kelly-hogan-geek-out-these-arent-droids" target="_blank">Straight Droids video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://www.baeblemusic.com/musicblog/7-10-2014/Neko-Case-and-Kelly-Hogan-Mock-Star-Wars-Fanboys-In-New-Video.html" target="_blank">BaebleMusic Droids video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://uproxx.com/webculture/2014/07/ellie-kemper-made-a-music-video-about-selfish-star-wars-fanboys-with-neko-case/" target="_blank">UPROXX Drods video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://www.undertheradarmag.com/news/watch_neko_case_and_kelly_hogan_these_arent_the_droids" target="_blank">UnderTheRadarMag Droids video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://www.chartattack.com/news/2014/07/10/watch-neko-case-kelly-hogan-rip-fanboy-culture-arent-droids/" target="_blank">Chartattack Droids video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://popwatch.ew.com/2014/07/10/neko-case-ellie-kemper-kelly-hogan-sci-fi-video/" target="_blank">EW.com Droids video post, July 10</a></span></strong></p><p><strong><span style="font-size:18px;"><a href="http://music.cbc.ca/#/blogs/2014/7/Neko-Case-Kelly-Hogan-and-Ellie-Kemper-save-the-future-for-women-in-These-Arent-the-Droids" target="_blank">CBC Music Droids video post, July 10</a></span></strong></p><p><strong><span style="font-si